import React, { Component } from "react";

class Main extends Component {
  state = {
    users: [
      {
        name: "Bibs",
        profit: 400,
        avg: 24.2,
        numOfGames: 4,
        pic:
          "https://scontent.ftlv6-1.fna.fbcdn.net/v/t1.0-9/18033232_10155139154718903_551895744160581652_n.jpg?_nc_cat=107&ccb=3&_nc_sid=e3f864&_nc_ohc=xWbRUVLxhkYAX-0frFd&_nc_ht=scontent.ftlv6-1.fna&oh=5b0145b33c8bc61196288d7384b78e5b&oe=60485387",
      },
      {
        name: "Vasil",
        profit: -250,
        avg: -33,
        numOfGames: 6,
        pic:
          "https://scontent.ftlv6-1.fna.fbcdn.net/v/t1.0-9/19510279_10211038676582034_283818198472784875_n.jpg?_nc_cat=106&ccb=3&_nc_sid=09cbfe&_nc_ohc=OsdHfrRYL7cAX9kj-gP&_nc_ht=scontent.ftlv6-1.fna&oh=1e7888e6ff929b88f1d4210165df05dd&oe=604A7BE2",
      },
      {
        name: "Rami",
        profit: 455,
        avg: 25,
        numOfGames: 7,
        pic:
          "https://scontent.ftlv6-1.fna.fbcdn.net/v/t1.0-9/27545083_10156074155317964_7105421858708513781_n.jpg?_nc_cat=102&ccb=3&_nc_sid=8bfeb9&_nc_ohc=3iXfn9iA030AX8KKeOA&_nc_ht=scontent.ftlv6-1.fna&oh=ec327ad145412034364f41055515745e&oe=6047A873",
      },
      { name: "Dudi", profit: -250, avg: -11, numOfGames: 8 },
    ],
  };
  render() {
    const { users } = this.state;
    return (
      <div className="container">
        <div className="row">
          <h1 className="text-center text-primary">Poker @ Vasili</h1>
          <table className="table table-bordered">
            <thead>
              <tr>
                <th>Name</th>
                <th>Pic</th>
                <th>Profit</th>
                <th>Avg</th>
                <th>Num Of Games</th>
              </tr>
            </thead>
            <tbody>
              {users.map((user) => (
                <tr key={user.name}>
                  <td>{user.name}</td>
                  <td>
                    <img
                      src={user.pic}
                      alt=""
                      style={{ width: 150, height: 100 }}
                    />
                  </td>
                  <td>{user.profit}</td>
                  <td>{user.avg}</td>
                  <td>{user.numOfGames}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    );
  }
}
export default Main;
